import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Game} from './Components/game';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <Game /> */}
        <p>Hello</p>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
